import React, { useState } from "react";
import FileSelector from "./file-selector";
const Document = () => {

    const [imageUrl, setImage] = useState("");
    return (
        <>
        {imageUrl}
            <FileSelector setImage={setImage} imageUrl={imageUrl}/>
        </>
    );
}



export default Document;
